//IMPORTANDO TYPES
import {
    TRAER_TICKET,
    TRAER_TICKET_EXITO,
    TRAER_TICKET_ERROR,
    AGREGAR_TICKET,
    AGREGAR_TICKET_EXITO, 
    AGREGAR_TICKET_ERROR
  } from "../types";

  export function crearNuevoTicketActiopm(ticket){
    return(dispatch)=>{
      dispatch(agregarTicket());
    }
  }

  const agregarTicket = (ticket) => ({
    type: AGREGAR_TICKET
  })

  import clienteAxios from "../config/axios.js";
